import { createTheme } from "@mui/material/styles";
import { red } from "@mui/material/colors";

// A custom theme for this app
const theme = createTheme({
  palette: {
    pallete: {
      darkBlue: "#193441",
      deepBlue: "#3E606F",
      midGreen: "#91AA9D",
      beige: "#D1DBBD",
      lightCream: "#FCFFF5",
    },
    primary: {
      main: "#556cd6",
    },
    secondary: {
      main: "#19857b",
    },
    error: {
      main: red.A400,
    },
  },
});

export default theme;
